import styled from 'styled-components'

export const StyledOrderedList = styled.ol`
    list-style-type: none;
    background: #ff9999;
    padding: 20px;

    li {
        background: #ffe5e5;
        padding: 5px;
        margin-left: 35px;
    }
    max-width: 500px;
`
